DROP TABLE IF EXISTS `emailmsg`;
CREATE TABLE `emailmsg` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '邮件id',
  `senderName` varchar(30) NOT NULL COMMENT '发送者名字，系统邮件为空',
  `receiverid` int(11) unsigned NOT NULL COMMENT '接受者ID',
  `emailtype` smallint(6) NOT NULL COMMENT '0个人邮件，1帮派邮件 2 系统邮件  10 竞拍成功  11 竞拍失败  12  拍卖成功   13  拍卖失败  15 战报  16  竞技场',
  `content` blob COMMENT '邮件内容',
  `itemid` smallint(6) DEFAULT '0' COMMENT '道具ID  -1 为加元宝',
  `itemnum` int(11) DEFAULT '0' COMMENT '道具数量',
  `pubid` int(10) unsigned DEFAULT NULL COMMENT '系统邮件，则为系统邮件ID，拍卖邮件则为拍卖ID',
  `isrecvattach` smallint(4) DEFAULT '0' COMMENT '是否已接收附件',
  `isread` smallint(4) DEFAULT '0' COMMENT '是否已读/sanguo修改为标示,0未读,1已读,2以取附件,3已删除',
  `inreceivebox` smallint(4) DEFAULT '0' COMMENT '是否已放入收件箱',
  `isdeleted` smallint(4) DEFAULT '0' COMMENT '是否已删除邮件',
  `inserttime` datetime DEFAULT NULL COMMENT '邮件发送时间',
  `serverid` int(11) unsigned DEFAULT NULL COMMENT '服务器编号',
  `expiretime` datetime DEFAULT NULL COMMENT '过期时间',
  PRIMARY KEY (`id`),
  KEY `receiverid` (`receiverid`,`emailtype`)
) ENGINE=InnoDB AUTO_INCREMENT=971 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

