-- ----------------------------
-- Procedure structure for `N_Leave_Get`
-- ----------------------------
DROP PROCEDURE IF EXISTS `N_Leave_Get`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `N_Leave_Get`(begintime int, leaveday int, itype int, num int, out  _outres int)
BEGIN
	# begintime 注册时间 leaveday 第几日的流失,  itype 1等级 2关卡 3vip等级,num  哪个点的数据(和itype相关,如等级=5), _outres 输出值
	if itype =1 then 
		select count(*) into _outres  from property where property.account in (SELECT warehouse.account FROM warehouse WHERE 
		TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) 
		AND TO_DAYS(property.SaveTime)-TO_DAYS(registerTime)<leaveday 
		AND property.SaveTime>=property.LoginTime 
		AND property.Level=num ) ;
	ELSEIF itype =2 then 
		select count(*) into _outres  from property where property.account in (SELECT warehouse.account FROM warehouse WHERE 
		TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) 
		AND TO_DAYS(property.SaveTime)-TO_DAYS(registerTime)<leaveday 
		AND property.SaveTime>=property.LoginTime 
		AND property.tollgate=num ) ;
	ELSEIF itype =3 then 
		select count(*) into _outres  from property where property.account in (SELECT warehouse.account FROM warehouse WHERE 
		TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) 
		AND TO_DAYS(property.SaveTime)-TO_DAYS(registerTime)<leaveday 
		AND property.SaveTime>=property.LoginTime 
		AND property.viplv=num  );
	ELSEIF itype =3 then 
		select count(*) into _outres  from property where property.account in (SELECT warehouse.account FROM warehouse WHERE 
		TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) 
		AND TO_DAYS(property.SaveTime)-TO_DAYS(registerTime)<leaveday 
		AND property.SaveTime>=property.LoginTime 
		AND property.guideID=num ) ;
	end IF;
END
;;
DELIMITER ;

