-- ----------------------------
-- Procedure structure for `N_operationGet`
-- ----------------------------
DROP PROCEDURE IF EXISTS `N_operationGet`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `N_operationGet`(_itype int, begintime int,  endtime int, out _res1 int, out _res2 int, out _res3 int, out _res4 int, out _res5 int, out _res6 int)
BEGIN 

/*
_itype =功能类型 1秘境寻宝,2将神传说,3过关斩将,4练武场;
_res1 开启人数
_res2 历史开启人数
_res3 参与总人数
_res4 参与总次数
_res5 购买重置人数
_res6 购买重置次数
*/
IF (_itype=1) then 
	SELECT lv10 INTO _res1 FROM lvlog WHERE  TO_DAYS(from_unixtime(endtime))=TO_DAYS(intime);
	SELECT lv10 INTO _res2 FROM lvlog WHERE  intime =(select max(intime) from lvlog);
ELSEIF (_itype=2) then 
	SELECT lv15 INTO _res1 FROM lvlog WHERE  TO_DAYS(from_unixtime(endtime))=TO_DAYS(intime);
	SELECT lv15 INTO _res2 FROM lvlog WHERE  intime =(select max(intime) from lvlog);
ELSEIF (_itype=2) then 
	SELECT lv18 INTO _res1 FROM lvlog WHERE  TO_DAYS(from_unixtime(endtime))=TO_DAYS(intime);
	SELECT lv18 INTO _res2 FROM lvlog WHERE  intime =(select max(intime) from lvlog);
ELSEIF (_itype=2) then 
	SELECT lv25 INTO _res1 FROM lvlog WHERE  TO_DAYS(from_unixtime(endtime))=TO_DAYS(intime);
	SELECT lv25 INTO _res2 FROM lvlog WHERE  intime =(select max(intime) from lvlog);
end if;

SELECT COUNT(*) INTO _res3 FROM operationlog WHERE UNIX_TIMESTAMP(intime)>=begintime and UNIX_TIMESTAMP(intime)<=endtime and itype=_itype ;
SELECT SUM(joinNum) INTO _res4  FROM  operationlog  WHERE unix_timestamp(intime)>=beginTime and  unix_timestamp(intime)<=endTime  AND itype =_itype;

SELECT COUNT(*) INTO _res5 FROM operationlog WHERE UNIX_TIMESTAMP(intime)>=begintime and UNIX_TIMESTAMP(intime)<=endtime and itype=_itype and resetNum>0;
SELECT SUM(resetNum) INTO _res6  FROM  operationlog  WHERE unix_timestamp(intime)>=beginTime and  unix_timestamp(intime)<=endTime  AND itype =_itype;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `N_operationSet`
-- ----------------------------
DROP PROCEDURE IF EXISTS `N_operationSet`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `N_operationSet`(_RoleID int,  _itype int, _optype int, _joinNum int, _resetNum int, _otherInfo int)
BEGIN
	#_itype =功能类型 1秘境寻宝,2将神传说,3过关斩将,4练武场;_optype =1参加次数,2重置次数;_otherInfo 关卡数据等
	SELECT COUNT(*) INTO @ret FROM  operationlog  WHERE  RoleID=_RoleID  AND TO_DAYS(intime )=TO_DAYS(NOW()) AND itype =_itype  ;
	IF(@ret < 1)THEN
		
	ELSE
		IF (_optype = 1) THEN
			UPDATE operationlog SET joinNum=joinNum+1,otherInfo=_otherInfo WHERE RoleID=_RoleID  AND TO_DAYS(intime )=TO_DAYS(NOW()) AND itype =_itype;
		ELSEIF (_optype = 2) THEN
			UPDATE operationlog SET resetNum=resetNum+1 WHERE RoleID=_RoleID  AND TO_DAYS(intime )=TO_DAYS(NOW()) AND itype =_itype;
		END IF;
	END IF;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `N_PointUse_Get`
-- ----------------------------
DROP PROCEDURE IF EXISTS `N_PointUse_Get`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `N_PointUse_Get`(optype int, begintime int, _itype int, _detailType int, _otherinfo int, _lv_mini int, _lv_max int, out _outres int)
BEGIN
	#取消费日志信息 
	if (optype =1) then 
		SELECT SUM(diff_value) INTO _outres  FROM playerpointlog WHERE itype=_itype  AND detailType=_detailType  
		AND otherinfo=_otherinfo  
		AND TO_DAYS(from_unixtime(begintime ))=TO_DAYS(intime)
		AND plevel >=_lv_mini   AND plevel <=_lv_max ;
	ELSEIF (optype =2) then 
		SELECT SUM(diff_value) INTO _outres  FROM playerpointlog WHERE itype=_itype  AND detailType=_detailType  
		AND otherinfo=_otherinfo  
		AND TO_DAYS(from_unixtime(begintime ))=TO_DAYS(intime)
		AND viplv >=_lv_mini   AND viplv <=_lv_max ;
	end if;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `N_StayGet30Day`
-- ----------------------------
DROP PROCEDURE IF EXISTS `N_StayGet30Day`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `N_StayGet30Day`(begintime int, out  _out_allreg int,  out _out_res1 int, out _out_res2 int, out _out_res3 int, out _out_res4 int, out _out_res5 int, out _out_res6 int, out _out_res7 int, out _out_res14 int, out _out_res21 int, out _out_res30 int)
BEGIN

	SELECT COUNT(*) into _out_allreg   FROM warehouse WHERE  TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime);

	SELECT COUNT(*)  into _out_res1 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=1);
	SELECT COUNT(*)  into _out_res2 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=2);
	SELECT COUNT(*)  into _out_res3 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=3);
	SELECT COUNT(*)  into _out_res4 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=4);
	SELECT COUNT(*)  into _out_res5 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=5);
	SELECT COUNT(*)  into _out_res6 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=6);
	SELECT COUNT(*)  into _out_res7 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=7);
	SELECT COUNT(*)  into _out_res14 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=14);
	SELECT COUNT(*)  into _out_res21 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=21);
	SELECT COUNT(*)  into _out_res30 FROM stay WHERE stay.account in (SELECT warehouse.account FROM warehouse 
		WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=30);

END
;;
DELIMITER ;

