CREATE DEFINER=`root`@`localhost` PROCEDURE `N_StayGetOneDay`(begintime int, num int, out _out_allreg int, out _out_res int)
BEGIN
		SELECT COUNT(*) into _out_allreg   FROM warehouse WHERE  TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime);
		SELECT COUNT(*) into _out_res  FROM stay WHERE account in (SELECT warehouse.account FROM warehouse WHERE TO_DAYS(from_unixtime(begintime ))=TO_DAYS(registerTime) AND
		TO_DAYS(stay.intime)-TO_DAYS(registerTime)=num );
END
;;
DELIMITER ;

