-- ----------------------------
-- Procedure structure for `p_EmailDelete`
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_EmailDelete`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_EmailDelete`(_id int, _id1 int, _id2 int, _id3 int, _id4 int, _id5 int, out _out_ret int)
    SQL SECURITY INVOKER
BEGIN
	
	SET _out_ret  = 0;
	SELECT COUNT(*) INTO @ret FROM  emailmsg  WHERE  id in (_id,_id1,_id2,_id3,_id4,_id5) ;
	IF(@ret >= 1)THEN
		if exists (select emailtype from emailmsg where id in (_id,_id1,_id2,_id3,_id4,_id5) and emailtype in (1,2,3) and pubid>0) then
			update emailmsg set isdeleted=1 where id in (_id,_id1,_id2,_id3,_id4,_id5) and emailtype in (1,2,3) and pubid>0;
		else
			DELETE FROM emailmsg WHERE id  in (_id,_id1,_id2,_id3,_id4,_id5);
		end if;
		SET _out_ret  = 1;
	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `p_EmailGetIsNew`
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_EmailGetIsNew`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_EmailGetIsNew`(_receiverid int, _severid int, _factionid int, out _out_ret int)
    SQL SECURITY INVOKER
BEGIN
	SET _out_ret  = 0;
if(ifnull(_factionid,0)>0) then  
	select '', _receiverid,emailtype,content,0,0,mailid,0,0,0,0,createtime,serverid,expiretime from sysmail where expiretime>now() and pubid=_factionid and mailid not in (select pubid from emailmsg where receiverid=_receiverid and pubid>0 and emailtype=1);
end if;
	select '', _receiverid,emailtype,content,0,0,mailid,0,0,0,0,createtime,serverid,expiretime from sysmail where expiretime>now() and pubid=0 and mailid not in (select pubid from emailmsg where receiverid=_receiverid and pubid>0 and emailtype in (2,3));
	SELECT COUNT(*) INTO @ret FROM  emailmsg  WHERE  receiverid=_receiverid  AND isread = 0 AND serverid=_severid and isdeleted=0;
	IF(@ret > 0)THEN
		SET _out_ret  = 1;
	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `p_EmailGetItem`
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_EmailGetItem`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_EmailGetItem`(_receiverid int, _id int, out _out_itemid int, out _out_itemnum int, out _out_content blob, out _out_emailtype int, out _out_ntime int, out _out_ret int)
    SQL SECURITY INVOKER
BEGIN
	SET _out_ret  = 0;
	SELECT COUNT(*) INTO @ret FROM  emailmsg  WHERE  id=_id AND receiverid=_receiverid AND isrecvattach = 0 and emailtype<>0;
	IF(@ret = 1)THEN
		SELECT UNIX_TIMESTAMP(inserttime), emailtype,itemid,itemnum,content INTO _out_ntime,_out_emailtype,_out_itemid,_out_itemnum,_out_content FROM  emailmsg  WHERE  id=_id AND receiverid=_receiverid ;
		UPDATE emailmsg SET isrecvattach=1,IsRead=1 WHERE id = _id AND receiverid=_receiverid ;
		SET _out_ret  = 1;
	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `p_EmailRead`
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_EmailRead`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_EmailRead`(_receiverid int, _emailtype int, _PageIndex int, _SeverID int, _factionid int, out _out_ret int)
    SQL SECURITY INVOKER
BEGIN
	declare _con varchar(30);
if(ifnull(_factionid,0)>0) then  
	select '', _receiverid,emailtype,content,0,0,mailid,0,0,0,0,createtime,serverid,expiretime from sysmail where expiretime>now() and pubid=_factionid and mailid not in (select pubid from emailmsg where receiverid=_receiverid and pubid>0 and emailtype=1);
end if;
	select '', _receiverid,emailtype,content,0,0,mailid,0,0,0,0,createtime,serverid,expiretime from sysmail where expiretime>now() and pubid=0 and mailid not in (select pubid from emailmsg where receiverid=_receiverid and pubid>0 and emailtype in (2,3));
SELECT COUNT(*) INTO _out_ret FROM  emailmsg  WHERE  receiverid=_receiverid and isdeleted=0 and emailtype<>15;
SET  @stmt = CONCAT('SELECT id,sendername,emailtype,content,itemid,itemnum,isrecvattach,isread,inserttime,expiretime FROM emailmsg WHERE  receiverid=',_receiverid, ' and emailtype<>15 and isdeleted=0 order by id desc  limit ?,?');
if(_emailtype<>0) then
	SELECT COUNT(*) INTO _out_ret FROM  emailmsg  WHERE  receiverid=_receiverid and isdeleted=0 and emailtype=15;
	SET  @stmt = CONCAT('SELECT id,sendername,emailtype,content,itemid,itemnum,isrecvattach,isread,inserttime,expiretime FROM emailmsg WHERE  receiverid=',_receiverid, ' and emailtype=',_emailtype,' and isdeleted=0 order by id desc  limit ?,?');
end if;
  prepare SQL1 FROM @stmt;
  SET @s1 = _PageIndex * 6;
  SET @s2= 6;
  execute SQL1 USING @s1,@s2;
  deallocate prepare SQL1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `p_EmailSend`
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_EmailSend`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_EmailSend`(_senderid int, _receivername varchar(20), _emailtype int, _content blob, _serverid int, _expiretime int, out _out_ret int)
    SQL SECURITY INVOKER
_RETURN : begin
	DECLARE _receiverid int;
	DECLARE _sendername varchar(11);
	DECLARE _mailnum int;
	DECLARE _maxnum int;
	SET _maxnum=35;
	SET _receiverid = -1;
	SET _mailnum = 0;
	SET _sendername = '';
	if(_receivername='' and _emailtype >=2) or _emailtype=1 then
		if (_emailtype=1) then
			SELECT factionid  INTO _receiverid FROM  factionlist where   factionname= _receivername;
			if (_receiverid=-1) then
				SET _out_ret  = -1 ;
				LEAVE _RETURN;
			end if;
		end if;
		if (_receiverid=-1) then
			set _receiverid=0;
		end if;
	else
		if(locate(char(31),_receivername)>0) then
			SELECT RoleID  INTO _receiverid FROM  property where   rolename = _receivername;
		else
			if exists(select * from property where roleid=_receivername) then
				set _receiverid=_receivername;
			end if;
		end if;
		if (_receiverid=-1) then
			select roleid into _receiverid from renamelog where oldrolename=_receivername;
		end if;
		SELECT rolename  INTO _sendername FROM  property where   roleid = _senderid;
		IF _receiverid <= 0  OR (_sendername = ''  and _emailtype < 2) THEN
			SET _out_ret  = -1 ;
			LEAVE _RETURN;
		END IF;
		IF ( _receiverid =  _senderid ) THEN
			SET _out_ret  = -2;
			LEAVE _RETURN;
		END IF;
		IF(_emailtype >=2 and _senderid=0)THEN
			SET _SenderName = '';
		else
			SELECT COUNT(*) INTO _mailnum FROM  emailmsg  WHERE  receiverid=_receiverid and isdeleted=0 and emailtype<2;
			IF(_mailnum >= _maxnum)THEN
				SET _out_ret  = -3;
				LEAVE _RETURN;
			END IF;
		END IF;
		if ifnull(_expiretime,21600)>=21600 then 
			set _expiretime=21600;
		end if;
			VALUES ( _sendername, _receiverid,_emailtype,_content,0,0,0,0,0,0,0,now(),_serverid,date_add(now(),INTERVAL _expiretime minute));
	end if;
	SET _out_ret = 0;
end
;
;;
DELIMITER ;

