-- ----------------------------
-- Procedure structure for `p_EmailSetRead`
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_EmailSetRead`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_EmailSetRead`(_id int,_readstate int,  out _out_ret int)
BEGIN
	SELECT COUNT(*) INTO @ret FROM  emailmsg  WHERE  id=_id AND IsRead<2  ;
	set _out_ret=0;
	IF(@ret = 1)THEN
		UPDATE emailmsg SET IsRead=_readstate WHERE id = _id;
		set _out_ret=1;
	END IF;
END
;;
DELIMITER ;

-- ----------------------------
