DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_pointlog`(uid int, _name char(45), _itype int, _diff_value int, _finale_value int, _detailType int, _pInfo int, _otherInfo int)
BEGIN
	DECLARE _viplv int;
	DECLARE _plevel int;
	SET _viplv=FLOOR(_pInfo/1000);
	SET _plevel=MOD(_pInfo,1000);
	values (uid ,_name ,NOW(),_itype ,_diff_value,_finale_value,_detailType ,_otherinfo,_viplv,_plevel);
END
;;
DELIMITER ;

